class landform_pos
{
public:
	//landform_pos(double x1 = 0, double y1 = 0, AREA landform1 = SEA, int land = 0) { x = x1; y = y1; landform = landform1; l = land; }
	landform_pos(XYPosition abs_pos)
	{
		double dx, dy;
		dx = abs_pos.x - (int)abs_pos.x / 100 * 100;
		dy = abs_pos.y - (int)abs_pos.y / 100 * 100;
		l = (int)abs_pos.x / 100 + 10 * ((int)abs_pos.y / 100);
		x = (int)abs_pos.x % 100;
		y = (int)abs_pos.y % 100;
		landform = MAP[l];
	}
	double x;
	double y;
	AREA landform;
	int l;
};
