	if (dy <= 0 && dx < 0) angle += 180;
	if (dy < 0 && dx > 0) angle += 360;
	if (dy > 0 && dx < 0) angle += 180;

	double distance = sqrt(dx * dx + dy * dy);
	return { distance,angle };
