void move(XYPosition abs_pos, double view_angle = info.self.view_angle)
{
	double dangle = abs_pol(abs_pos).angle;
	double _dangle = view_angle - info.self.view_angle;
	if (_dangle < 0) _dangle += 360;
	if (frame % 2)move(dangle, _dangle, -1);
}
