bool move_pickup(int target_ID, XYPosition abs_pos, int	parameter = -1)
{
	bool picked = 1;
	static bool turn_head = 1;
	if (turn_head == 0)
	{
		for (int i = 0; i < info.items.size(); i++) if (info.items[i].item_ID == target_ID) picked = 0;
	}
	else picked = 0;
	if (picked) { turn_head = 1; std::cout << "picked" << std::endl; return 1; }
	if (abs_pol(abs_pos).distance < 1 && turn_head == 0) { std::cout << "picking" << std::endl; pickup(target_ID, parameter); turn_head = 1; return 1; }
	else if (turn_head == 1) { std::cout << "turn head" << std::endl; move(0, abs_pol(abs_pos).angle, NOMOVE); turn_head = 0; return 0; }
	else { std::cout << "moving" << std::endl; block_move(abs_pos); return 0; }
}
