int help(XYPosition abs_pos, int ID = 0)
{
	static bool look = 1;
	double angle = abs_pol(abs_pos).angle;
	XYPosition aim = abs_pos;
	bool firstaidcase = 0;
	for (int i = 0; i < info.self.bag.size(); i++)
	{
		if (info.self.bag[i].type == 16 && info.self.bag[i].durability > 0) { firstaidcase = 1; break; }
	}
	bool bondage = 0;
	for (int i = 0; i < info.self.bag.size(); i++)
	{
		if (info.self.bag[i].type == 15 && info.self.bag[i].durability > 0) { bondage = 1; break; }
	}
	if (!firstaidcase && !bondage) return -1;
	if (look)
	{
		move(0, angle, NOMOVE);
		look = 0;
		return 0;
	}
	else if (abs_pol(aim).distance < PICKUP_DISTANCE && !info.self.attack_cd)
	{
		look = 1;
		for (int i = 0; i < info.others.size(); i++)
		{
			if (info.others[i].player_ID == ID) aim = pol_abs(info.others[i].polar_pos);
		}
		if (firstaidcase) { shoot(FIRST_AID_CASE, abs_pol(aim).angle, ID); }
		else shoot(BONDAGE, abs_pol(aim).angle, ID);
		return 1;
	}
	else if (abs_pol(aim).distance < PICKUP_DISTANCE && info.self.attack_cd)
	{
		for (int i = 0; i < info.others.size(); i++)
		{
			if (info.others[i].player_ID == ID) aim = pol_abs(info.others[i].polar_pos);
		}
		return 0;
	}
	else 
	{ 
		for (int i = 0; i < info.others.size(); i++)
		{
			if (info.others[i].player_ID == ID) aim = pol_abs(info.others[i].polar_pos);
		}
		block_move(aim); return 0; 
	}
}
